import React from "react";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import "./Program.css";

export default function Program(dataTime) {
  return (
    <div>
      <Grid item xs={4}>
        <Paper className="program">{dataTime}</Paper>
      </Grid>
    </div>
  );
}
